import React, { PureComponent, useState, useEffect } from 'react';
import axios from 'axios';

function DataFetching() {
  const [clients, getClients] = useState([]);
  useEffect(() => {
    axios
      .get(
        'https://cors-anywhere.herokuapp.com/https://localhost:7275/Client/GetAllClients',
      )
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  });
  return (
    <div>
      <ul>
        {clients.map((client) => {
          <li key={client.ClientId}>{client.FirstName}</li>;
        })}
      </ul>
    </div>
  );
}

export default DataFetching;
